import React from "react";
import "../styles/Header.css";

const style = {
  bg: {
    background: "red"
  },
  text: {
    fontSize: "100px"
  }
}

function Header() {
  return (
    <header className="header" style = {StyleSheet.bg}>
      <h1>Welcome</h1>
    </header>
  );
}

export default Header;
